        <Col span={6} />
        <Col span={6} />
        <Col span={6} />
        <Col span={6} />

        <Col span={6} />
        <Col span={6} />
        <Col span={6} />
        <Col span={6} />
      </Row>
      <Row gutter={[40, 8]}>
        <Col span={6} />
        <Col span={6} />
        <Col span={6} />
        <Col span={6} />
      </Row>
    </div>
  );
};

export default FootComponent;
